import React, { useState } from "react";

function App() {
  const [skills, setSkills] = useState("");
  const [interest, setInterest] = useState("tech");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const [jobListings, setJobListings] = useState([]);
  const [jobsLoading, setJobsLoading] = useState(false);

  const fetchJobs = async (keyword) => {
    setJobsLoading(true);
    try {
      const response = await fetch(`http://127.0.0.1:8000/jobs?keyword=${encodeURIComponent(keyword)}`);
      const data = await response.json();
      if (data.jobs) {
        setJobListings(data.jobs);
      } else {
        setJobListings([]);
      }
    } catch (error) {
      console.error("Failed to fetch jobs:", error);
      setJobListings([]);
    }
    setJobsLoading(false);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setResult(null);
    setJobListings([]);

    const inputData = {
      skills: skills.split(",").map(skill => skill.trim().toLowerCase()),
      interests: [interest],
    };

  try {
  const response = await fetch("http://127.0.0.1:8000/predict", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify(inputData),
  });

  // Log status and response
  console.log("Status:", response.status);
  const data = await response.json();
  console.log("Backend response data:", data);

  if (!response.ok) {
    throw new Error(`Backend error: ${data.detail || 'Unknown error'}`);
  }

  setResult(data.recommendation);

  if (data.recommendation && data.recommendation.length > 0) {
    await fetchJobs(data.recommendation[0].career);
  }
} catch (error) {
  console.error("Prediction failed:", error);
  setResult([{ career: "Error", fit: 0 }]);
}


    setLoading(false);
  };

  return (
    <div style={{ padding: "2rem", fontFamily: "Arial" }}>
      <h1>Skillmap AI — Career Predictor</h1>

      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: "1rem" }}>
          <label>Skills (comma-separated):</label><br />
          <input
            type="text"
            value={skills}
            onChange={(e) => setSkills(e.target.value)}
            placeholder="e.g. python, programming"
            style={{ width: "100%", padding: "0.5rem" }}
            required
          />
        </div>

        <div style={{ marginBottom: "1rem" }}>
          <label>Interests:</label><br />
          <select
            value={interest}
            onChange={(e) => setInterest(e.target.value)}
            style={{ width: "100%", padding: "0.5rem" }}
          >
            <option value="tech">Tech</option>
            <option value="business">Business</option>
            <option value="art">Art</option>
            <option value="marketing">Marketing</option>
          </select>
        </div>

        <button type="submit" style={{ padding: "0.5rem 1rem" }}>
          {loading ? "Loading..." : "Get Career Recommendation"}
        </button>
      </form>

      {/* Recommended Careers */}
      {result && (
        <div style={{ marginTop: "2rem" }}>
          <h3>Recommended Careers:</h3>
          <ul>
            {result.map((item, index) => (
              <li key={index}>
                <strong>{item.career}</strong> — Fit Score: {item.fit.toFixed(2)}%
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Job Listings */}
      {jobsLoading && <p>Loading job listings...</p>}

      {jobListings.length > 0 && (
        <div style={{ marginTop: "2rem" }}>
          <h3>Job Listings for {result[0]?.career}:</h3>
          <ul>
            {jobListings.map((job, index) => (
              <li key={index} style={{ marginBottom: "1rem" }}>
                <a href={job.redirect_url} target="_blank" rel="noopener noreferrer" style={{ fontWeight: "bold" }}>
                  {job.title}
                </a><br />
                Company: {job.company || "N/A"}<br />
                Location: {job.location || "N/A"}<br />
                Salary: {job.salary_min ? `$${job.salary_min}` : "N/A"} - {job.salary_max ? `$${job.salary_max}` : "N/A"}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
